package db.domain;import java.util.Arrays;public class LogBossAwardImpl implements LogBossAward {	@Key	private int logId;	private String uname;	private String nick;	private int propId;	private int count;	public LogBossAwardImpl() {	}	public LogBossAwardImpl(LogBossAward c) {		this.logId = c.getLogId();		this.uname = c.getUname();		this.nick = c.getNick();		this.propId = c.getPropId();		this.count = c.getCount();	}	@Override	public String tableName() {		return "log_boss_award";	}	public void setLogId(int logId) {		this.logId = logId;	}	public int getLogId() {		return this.logId;	}public void addLogId(int logId) {		this.logId += logId;}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setNick(String nick) {		this.nick = nick;	}	public String getNick() {		return this.nick;	}public void addNick(String nick) {		this.nick += nick;}	public void setPropId(int propId) {		this.propId = propId;	}	public int getPropId() {		return this.propId;	}public void addPropId(int propId) {		this.propId += propId;}	public void setCount(int count) {		this.count = count;	}	public int getCount() {		return this.count;	}public void addCount(int count) {		this.count += count;}}